import React from "react";
import {FaCopyright} from "react-icons/fa";

const Footer = () => {
    return(
        <>
            <section className="footer-section">
                <h1><FaCopy /> Oreland Library Management System</h1>
            </section>
        </> 
    );
}
export default Footer;
